import React from 'react'
import Hero from '../components/Hero'
import ProjectCards from '../components/ProjectCards'
import data from "../projectData"

export default function Home() {
    const projects = data.map((item) => {
        return < Journeys
            key={projects.id}
            item={projects}
        />

    })
    return (
        <div>
            <Hero />
            <ProjectCards />

        </div>
    )
}
